import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import Upload from "./components/Upload";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect,
  Link
} from "react-router-dom";
import axios from "axios";

const apiKey = "c354bbd6-1b57-4f1e-b0f3-8743d4495710";

const randomVideo = new Promise((resolve, reject) => {
  axios
    .get(`https://project-2-api.herokuapp.com/videos?api_key=<${apiKey}>`)
    .then(responseArr => {
      const randomVideo =
        responseArr.data[Math.floor(Math.random() * responseArr.data.length)];
      resolve(randomVideo.id);
    });
});

const randomVideoId = () => {
  randomVideo.then(resolve => {
    return resolve;
  });
};

ReactDOM.render(
  <Router>
    <Switch>
      {/* <Redirect from="/" to={`/videos/${randomVideo}`} /> */}
      <Route path="/" component={App} exact />
      <Route path="/videos/:id" component={App} />
      <Route path="/upload" component={Upload} />
    </Switch>
  </Router>,
  document.getElementById("root")
);
